        /// <summary>
        /// 开奖时间
        /// </summary>
        public static List<IssueTime> OpenTimeList => OpenTime.ToEntity<List<IssueTime>>();

        /// <summary>
        /// 取当前期数
        /// </summary>
        /// <returns></returns>
        public static IssueInfo GetIssueInfo()
        {
            List<IssueTime> list = OpenTimeList;
            if (list == null || list.Count == 0)
            {
                return null;
            }

            DateTime currentTime = DateTime.Now;//当前时间
            string curentDateStr = currentTime.ToString("yyyy/MM/dd");  //当前时间日期部分
            foreach (var item in list)
            {
                DateTime beginTime = Convert.ToDateTime(curentDateStr + " " + item.BeginTime).AddDays(Convert.ToDouble(item.BeginUseDate));
                DateTime endTime = Convert.ToDateTime(curentDateStr + " " + item.EndTime).AddDays(Convert.ToDouble(item.EndUseDate));

                if (int.Parse(item.Issue.Replace("s", "")) == 193)
                {
                    endTime = endTime.AddDays(1);
                }

                if (currentTime < beginTime || currentTime >= endTime)
                {
                    continue;
                }

                if (int.Parse(item.Issue.Replace("s", "")) > 193)
                {
                    beginTime = beginTime.AddDays(-1);
                }

                if (currentTime >= beginTime && currentTime < endTime)
                {
                    string issueFormat = string.Empty;
                    issueFormat = beginTime.ToString("yyyyMMdd");
                    IssueInfo cii = new IssueInfo()
                    {
                        IssueNo = issueFormat + item.Issue.Replace("s", ""),
                        RemainTime = endTime - currentTime,
                    };
                    return cii;
                }
            }

            return null;
        }
    }
